import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getPhotos } from "./Store/Store.js";
import '../src/App.css';


const App =_=> {
  const dispatch = useDispatch();
  const photos = useSelector(state => state.gallery.photos);
  console.log(photos);
  useEffect(() => {
    dispatch(getPhotos());
  }, [dispatch]);

  console.log(photos);
  return (
    <div className='App'>
      <h1>Photo Gallery</h1>
      <p>This is a photo gallery made using redux toolkit and redux thunk.</p>
      <div>
        {photos.map(photo => 
          <img key={photo.id}
          alt={photo.author}
          src={photo.dowload_url}
          width='400'
          height='400'
          />
          )}
      </div>
    </div>
  )
}
export default App;
